import React from "react";
import classes from './Loader.module.css'

const Loader =() => {
    return (
        <div>
            <div  className={classes.lineLoad}/>
            <div  className={classes.load}/>
            <button className={classes.delete}/>
        </div>
    );
};

export default Loader;
